import React, { Component } from 'react';
import ProfilePic from '../Assets/ProfilePic.png';
import { Grid, Cell } from 'react-mdl';
import Education from './education';
import Experience from './experience';
import Skills from './skills';

class Resume extends Component {
    render() {
        return (

            <div>
                <Grid>
                    <Cell col={4}>
                        <div style={{ textAlign: 'center' }}>
                            <img
                                src={ProfilePic}
                                alt="avatar"
                                style={{ height: '200px' }}
                            />
                        </div>

                        <h2 style={{ paddingTop: '2em', color: '#b92b27' }}>Karan Kr. Gupta</h2>
                        <h4 style={{ color: 'grey' }}>Programmer</h4>
                        <hr style={{ borderTop: '3px solid #833fb2', width: '50%' }} />
                        <p>Though I have no experience ,yet proficient in HTML/CSS, JavaScript,Bootstrap and ReactJs & Flutter; plus modern libraries and frameworks.Building websites and apps that are responsive and usable.Identifying innovative ideas and proof of concepts according to project requirements.</p>
                        <hr style={{ borderTop: '3px solid #833fb2', width: '50%' }} />
                        <h5 style={{ color: 'grey', fontWeight: 'bold' }}>Address</h5>
                        <p>J-4/9,Krishna Nagar,Delhi</p>
                        <h5 style={{ color: 'grey', fontWeight: 'bold' }}>Phone</h5>
                        <p>(+91) 8802030518</p>
                        <h5 style={{ color: 'grey', fontWeight: 'bold' }}>Email</h5>
                        <p>karangupta308@gmail.com</p>
                        <h5 style={{ color: 'grey', fontWeight: 'bold' }}>Web</h5>
                        <p>karangupta308.com</p>
                        <hr style={{ borderTop: '3px solid #833fb2', width: '50%' }} />
                    </Cell>
                    <Cell className="resume-right-col" col={8}>
                        <h2 style={{ color: 'grey', fontWeight: 'bold' }}>Education</h2>


                        <Education
                            startYear={2016}
                            endYear={2020}
                            schoolName="ABES Institute Of Technology"
                            schoolDescription="Pursued my BTech in Computer Science branch from this college."
                        />

                        <Education
                            startYear={2015}
                            endYear={2016}
                            schoolName="Bal Mandir Sr. Sec. School"
                            schoolDescription="Pursued my Higher Education(Class 12th) in Science branch from this school."
                        />

                        <Education
                            startYear={2015}
                            endYear={2016}
                            schoolName="Bal Mandir Sr. Sec. School"
                            schoolDescription="Pursued my Intermediate Education(Class 10th) from this school."
                        />
                        <hr style={{ borderTop: '3px solid #e22947' }} />

                        <h2 style={{ color: 'grey', fontWeight: 'bold' }}>Experience</h2>

                        <Experience
                            startYear={2019}
                            jobName="Internship in Airtel,Gurgaon"
                            jobDescription="(10th June 2019 to 19th August 2019) The task was to develop the ‘Web UI’ for the Customer Database being maintained by the Admins using ReactJS.
                  Also made the related APIs using Spring Boot."
                        />


                        <hr style={{ borderTop: '3px solid #e22947' }} />
                        <h2 style={{ color: 'grey', fontWeight: 'bold' }}>Skills</h2>
                        <Skills
                            skill="React"
                            progress={70}
                        />
                        <Skills
                            skill="HTML/CSS"
                            progress={50}
                        />
                        <Skills
                            skill="Bootstrap"
                            progress={60}
                        />
                        <Skills
                            skill="Springboot"
                            progress={30}
                        />
                         <Skills
                            skill="JavaScript"
                            progress={50}
                        />
                         <Skills
                            skill="Flutter"
                            progress={70}
                        />



                    </Cell>
                </Grid>
            </div>


        );

    }
}

export default Resume;
